import React from 'react'
import { useState } from 'react';
function ProfileCards() {
  const [selectedTab, setSelectedTab] = useState('BUGS');
  const handleTabClick = (tab) => {
    setSelectedTab(tab);
  };
const renderTableContent = () => {
  switch (selectedTab) {
    case 'BUGS':
      return (
        <table className="min-w-full divide-y divide-gray-200">
          <thead className="bg-gray-50">
            <tr>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Bug ID</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Description</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Status</th>
            </tr>
          </thead>
          <tbody className="bg-white divide-y divide-gray-200">
            <tr>
              <td className="px-6 py-4 text-sm text-gray-900">1</td>
              <td className="px-6 py-4 text-sm text-gray-500">Bug description 1</td>
              <td className="px-6 py-4 text-sm text-gray-500">Open</td>
            </tr>
          </tbody>
        </table>
      );
    case 'WEBSITE':
      return (
        <table className="min-w-full divide-y divide-gray-200">
          <thead className="bg-gray-50">
            <tr>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Page</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Visits</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Status</th>
            </tr>
          </thead>
          <tbody className="bg-white divide-y divide-gray-200">
            <tr>
              <td className="px-6 py-4 text-sm text-gray-900">Home</td>
              <td className="px-6 py-4 text-sm text-gray-500">1000</td>
              <td className="px-6 py-4 text-sm text-gray-500">Active</td>
            </tr>
          </tbody>
        </table>
      );
    case 'SERVER':
      return (
        <table className="min-w-full divide-y divide-gray-200">
          <thead className="bg-gray-50">
            <tr>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Server</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Status</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Uptime</th>
            </tr>
          </thead>
          <tbody className="bg-white divide-y divide-gray-200">
            <tr>
              <td className="px-6 py-4 text-sm text-gray-900">Server 1</td>
              <td className="px-6 py-4 text-sm text-gray-500">Online</td>
              <td className="px-6 py-4 text-sm text-gray-500">24 days</td>
            </tr>
          </tbody>
        </table>
      );
    default:
      return null;
  }
};

return (
  <div className='w-full h-auto ml-1 bg-white rounded drop-shadow-md p-3 mt-10 lg:mt-0'>
    <div className='bg-gradient-to-r from-green-600 to-green-700 px-3 py-5 rounded text-white flex justify-center'>
      <ul className='text-xs flex ml-3 space-x-16'>
        <li
          className={`flex px-2 py-3 cursor-pointer ${selectedTab === 'BUGS' ? 'bg-gray-100 bg-opacity-20' : ''}`}
          onClick={() => handleTabClick('BUGS')}
        >
          BUGS
        </li>
        <li
          className={`flex px-2 py-3 cursor-pointer ${selectedTab === 'WEBSITE' ? 'bg-gray-100 bg-opacity-20' : ''}`}
          onClick={() => handleTabClick('WEBSITE')}
        >
          WEBSITE
        </li>
        <li
          className={`flex px-2 py-3 cursor-pointer ${selectedTab === 'SERVER' ? 'bg-gray-100 bg-opacity-20' : ''}`}
          onClick={() => handleTabClick('SERVER')}
        >
          SERVER
        </li>
      </ul>
    </div>
    <div className='mt-5'>
      {renderTableContent()}
    </div>
  </div>

  )
}

export default ProfileCards
